import { NavLink } from "react-router-dom";
import  {connect} from  'react-redux'
function HeaderPage({numberCart}) {
    console.log(numberCart)
    return ( 
        <div className="bg-white  py-2 top-0 right-0 w-full h-1/12 fixed">
            
            <div className="flex justify-between items-center">
                <div className="ml-4 text-gray-500 text-lg">
                    <NavLink to = '/home' className=' hover:text-black '>Home</NavLink>
                    <NavLink to = '/products' className=' ml-4 hover:text-black'>Products</NavLink>
                    <NavLink to = '/reviews' className=' ml-4 hover:text-black'>Reviews</NavLink>
                </div>
                <div className="w-1/3">
                    <h2 className="text-2xl text-blue-500 font-bold text-center">Demo</h2>
                </div>
                <div className="w-1/3">
                    <div className="flex items-center justify-end">
                        <div className="rounded-full relative flex items-center 
                        justify-center text-2xl w-10 h-10 text-blue-500">
                            <NavLink to ='/checkout' >
                                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-cart-fill" viewBox="0 0 16 16">
                                        <path d="M0 1.5A.5.5 0 0 1 .5 1H2a.5.5 0 0 1 .485.379L2.89 3H14.5a.5.5 0 0 1 .491.592l-1.5 8A.5.5 0 0 1 13 12H4a.5.5 0 0 1-.491-.408L2.01 3.607 1.61 2H.5a.5.5 0 0 1-.5-.5zM5 12a2 2 0 1 0 0 4 2 2 0 0 0 0-4zm7 0a2 2 0 1 0 0 4 2 2 0 0 0 0-4zm-7 1a1 1 0 1 1 0 2 1 1 0 0 1 0-2zm7 0a1 1 0 1 1 0 2 1 1 0 0 1 0-2z"/>
                                </svg>
                                <p>
                                    {numberCart}
                                </p>
                            </NavLink>
                        </div>
                    </div>
                </div>
            </div>
        </div>   
        
     );
}
const mapStateToProps = state =>{
        return{
            numberCart:state.ReduxProduct.numberCart
        }
    }
// export default HeaderPage;
export default connect(mapStateToProps,null)(HeaderPage)
